	Image backImage;
	
	public DiagramFigure(JSFDiagramEditPart editPart) {
		super();
		this.editPart = editPart;
		setLayoutManager(new FreeformLayout());
		setBorder(new MarginBorder(5));
		setBackgroundColor(ColorConstants.white);
		setOpaque(true);
		ImageData imageData = new ImageData(90, 90, 8,
				new PaletteData(new RGB[] { new RGB(255, 255, 255),
						new RGB(0xde, 0xde, 0xde) }));

		for (int x = 0; x < 90; x++) {
			for (int y = 0; y < 90; y++) {
				imageData.setPixel(x, y, iData[x][y]);
			}
		}

		backImage = new Image(null, imageData);
	}

	protected void paintFigure(Graphics g) {
		super.paintFigure(g);
		Rectangle r = getBounds().getCopy();
		g.translate(r.getLocation());
		int width = r.width;
		int height = r.height;

		if (editPart.getJSFModel().isBorderPaint()
				&& !(g instanceof PrinterGraphics)) {
			for (int x = 0; x < width; x += 90) {
				for (int y = 0; y < height; y += 90) {
					g.drawImage(backImage, x, y);
				}
			}
		}

		if (editPart.isGridVisible() && !(g instanceof PrinterGraphics)) {
			g.setLineStyle(Graphics.LINE_DOT);
			g.setForegroundColor(lightGrayColor);
			g.setBackgroundColor(ColorConstants.white);
			for (int i = 0; i < width; i += editPart.getVisualGridStep()) {
				g.drawLine(i, 0, i, height - 1);
			}
			for (int i = 0; i < height; i += editPart.getVisualGridStep()) {
				g.drawLine(0, i, width, i);
			}
			g.setLineStyle(Graphics.LINE_SOLID);
		}
	}

